import { useEffect, useState } from "react";
import HOST from "../Setup";

function Students() {
  const [loading, setLoading] = useState(true);
  const [students, setStudents] = useState([]);

  useEffect(() => {
    const url = HOST + "/Students";
    fetch(url)
      .then((response) => {
        response.json().then((result) => {
          setStudents(response);
        });
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  return (
    <div className="container">
      <h3 className="text-center">All professors</h3>
      {loading && (
        <div>
          <img
            className="center-img"
            height="60%"
            src={require("../Images/loading.gif")}
            alt="Welcome to app"
          />
        </div>
      )}
      <table class="table table-bordered">
        <thead>
          <tr>
            <th scope="col">Firstname</th>
            <th scope="col">Lastname</th>
            <th scope="col">Sex</th>
            <th scope="col">Academic title</th>
            <th scope="col">More info</th>
          </tr>
        </thead>
        <tbody>
          {professors.map((e, i) => (
            <tr key={i}>
              <td>{e.firstname}</td>
              <td>{e.lastname}</td>
              <td>{e.sex === "M" ? "Man" : "Woman"}</td>
              <td>{e.academicTitle}</td>
              <td className="text-center">
                <img
                  src={require("../Images/more-info.jpg")}
                  alt="More info"
                  title="More informations"
                  className="btn"
                  onClick={() => setProfessorInfo(e)}
                />
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <div>
        {professorInfo != null ? (
          <ProfessorDetails professor={professorInfo} />
        ) : (
          <>Glupost</>
        )}
      </div>
    </div>
  );
}

export default Students;
